import { GET_SONGS, ADD_SONG } from '../actions/types';

const initialState = {
	songs: [
		{ 
			genre: ["folclor","populara","de petrecere"],
			_id: "11",
			artist: "Maria Tanase",
			name: "Bun ii vinul ghiurghiuliu",
			duration: 213,
		},
		{ 
			genre: ["usoara","pop","de petrecere"],
			_id: "22",
			artist: "Mandinga",
			name: "Soarele meu",
			duration: 188,
		},
		{ 
			genre: ["rock"],
			_id: "33",
			artist: "Pheonix",
			name: "Nunta",
			duration: 247,
		},
	]
};

// eslint-disable-next-line import/no-anonymous-default-export
export default function(state = initialState, action) {
	switch(action.type) {
		case GET_SONGS:
			return {
				...state
			}
		default:
			return state
	}
}
